— КАСКО – необязательно.


Техническая диагностика – мы проверили состояние всех наших автомобилей по 86 пунктам. Со всеми результатами диагностики Вы можете подробно ознакомиться у нас в салонах.

Предоставляем гарантию юридической чистоты, а так же год технической гарантии на двигатель и КПП в письменной форме.


Работаем ежедневно, без праздников и выходных: 9: 00 - 21: 00!
Крытое  освещенное помещение!

Записаться на тест-драйв, а так же получить подробную информацию можно у специалистов автоцентра по указанному номеру телефона.

Приглашаем Вас на бесплатный тест-драйв!

•	Все заявленные автомобили находятся в наличии.
•	Закрытое, теплое, хорошо освещенное помещение!
•	Дополнительные комиссии отсутствуют.
•	Выгода по программе Trade - In от 10 000 до 70 000 рублей.

ТЕХНИЧЕСКАЯ ДИАГНОСТИКА – проводится полная комплексная диагностика всех наших автомобилей.
ЮРИДИЧЕСКАЯ ЧИСТОТА - каждый автомобиль при поступлении проходит криминалистическую и юридическую проверку
АВТОКРЕДИТОВАНИЕ для всех регионов РФ!
Сотрудничаем с 15 аккредитованными и сертифицированными банками РФ, среднее время ожидания решения банка 30-40 минут.
•	Минимальный пакет документов – паспорт и водительское удостоверение РФ;
